        schedulegigs:function(){ },
        updatethesetlist:function(){ }
    })
    return (<div>
        <ul>
            {Object.keys(MusicBandManager).map((key) => {
                return <li>{MusicBandManager[key]}</li>
            })}
        </ul>
    </div>
    )
}
